close all
clearvars -except mapCD
fn = 'D:\od\OneDrive\matlab\RawData\1T-TaS2(point defect)\mapCD.mat';
loadif(fn); %[output:20ea1dd8] %[output:7f55cad5] %[output:747c86ff]
%%
%[text] ## Masked FFT filter
%[text] ### Create FFT mask
%[text] for iph = 1
iph = 1 %[output:53d982b6]
mskTbl =table() %[output:6b268df2]
mskTbl.arr = 
mskTbl.intention = 
mskTbl.result = 
%%

Z = mapCD.dt(iph).Z;
fZ = fft2(Z);
afZ = abs(fZ);
bin = afZ> 0.001*max(max(afZ)) %[output:94169553]
%%
mskTbl =table() %[output:5343fae4]
mskTbl(1,1) = {bin} %[output:9751a4f2]
mskTbl{1,2} = '2nd order peak visible histogram cut' %[output:1247524a]
mskTbl{1,3} = '?' %[output:1feafacb]
mskTbl.Properties.VariableNames = {'arr' 'intention' 'result'} %[output:6b3bd0f7]
%%
mskTbl(end+1,:) = {R4fft(size(Z))>35 'remove lowFreq' '?'} %[output:796d80c4]
%%
binr = R4fft(size(Z))>35 %[output:5aaebad7]
binr2 = R4fft(size(Z))<1130 %[output:5a637117]
binr12 = binr&binr2 %[output:2170ffee]
bin3 = bin&binr12 %[output:04d8962a]
%[text] for iph = 2

groot().Children %[output:3b8d8999]
%%
%[text] ## Draw filtered result
%[text] Main function
mskTbl(1,:) %[output:15f37e44]
[f,sbs] =  plt_Fourier_filtered_synthesis(Z,bin) %[output:241daec0] %[output:96874865] %[output:41a31bfa] %[output:373f10b3] %[output:18590e72] %[output:7c4a57e7] %[output:9ad497a5] %[output:6723e1af] %[output:047f2f14] %[output:8fbe0872] %[output:7fa078c2] %[output:091385cc] %[output:13dfbb1c] %[output:0e404a2f] %[output:9c48034c] %[output:8725b1e9] %[output:9e6e0951]
f.Visible = "on" %[output:0ee0d134]
f.Position = [0 0 2000 1000] %[output:2e8d2cd6] %[output:9e6e0951]
%[text] colorlim modification
f.CurrentAxes = sbs(1,2) %[output:026ac22b]
climsc([0, 0.01]).Minmax %[output:9bfb72a9] %[output:9e6e0951]
sbs(2,3).CLim = sbs(1,2).CLim %[output:9e6e0951] %[output:3060d6bb]
%%
se = strel('disk',2) %[output:7c86a941]
views(se.Neighborhood) %[output:464991c5]
