%[text] ### 
%[text] 
function titlet(str)
title(str)
ax = gca;
ax.Tag = str;
end
%[text] 
function viewst(img)
views(fftshift(img))
end
%[text] 
function popViewst(bin)
f = figure(10)
views(fftshift(bin))
f.Visible = "on"
end


